(3, 'piloto', 'Walter White, profesor de química en un instituto, descubre que tiene cáncer de pulmón y decide trabajar junto con un ex-alumno elaborando metanfetamina de alta calidad para poder ganar dinero para que su familia se mantenga.', 56, 1, 1, 1, 'https://clipwatching.com/yxv51d04jxus/Breaking_Bad_1x01_Pilot.mkv.html', NULL, NULL),
(4, 'El gato esta en la bolsa', 'Walter y Jesse tratan de atar cabos sueltos, pero la situación se vuelve cada vez más compleja rápidamente. Mientras, Skyler empieza a sospechar del comportamiento de Walt.', 54, 1, 2, 1, 'https://clipwatching.com/60mwumytrup5/Breaking_Bad_1x02_The_Cat_Is_In_The_Bag.mkv.html', NULL, NULL),
(5, 'Stalingrado', 'Noviembre de 1942. Continúa el implacable asedio a la ciudad de Stalingrado durante la Segunda Guerra Mundial. Rodeados de tropas alemanas y escasos de municiones, un grupo de soldados rusos se preparan para defender un edificio hasta el final.', 130, 3, 1, 3, 'https://clipwatching.com/jmr3k8sxo1dl/Stalingrado_Castellano_720p.avi.html', NULL, NULL),
(6, 'Y la bolsa esta en el rio', 'Walter pelea con Jesse debido a su adicción a las drogas y Jesse se va, dejándole solo con su cautivo, Krazy-8; Hank lleva a Walter Jr. a dar un paseo para hablarle acerca de la marihuana; a Skyler no le gusta que Walt esté tan ausente de casa.', 48, 1, 3, 1, 'https://clipwatching.com/kbe5ha0mx9w4/Breaking_Bad_1x03_And_The_Bag_Is_In_The_River.mkv.html', NULL, NULL),
(7, 'Hombre cancer', 'Walter finalmente revela a su familia que tiene cáncer. La DEA cree que hay en Albuquerque un nuevo pez gordo del que preocuparse. Jesse hace una visita a la casa de sus padres y Walt acaba desahogando su furia.', 48, 1, 4, 1, 'https://clipwatching.com/nsmtynk2n8dm/Breaking_Bad_1x04_Cancer_Man.mkv.html', NULL, NULL),
(8, 'Materia Gris', 'Walter y Skyler van a la fiesta de cumpleaños de un ex-compañero. Jesse trata de librarse de las drogas. Skyler reúne a la familia para que puedan hablar.', 48, 1, 5, 1, 'https://clipwatching.com/4e9a6xzx1yrv/Breaking_Bad_1x05_Gray_Matter.mkv.html', NULL, NULL),
(9, 'Nada como un puñado de locura', 'Los efectos secundarios de la quimioterapia empiezan a afectar a Walt. Mientras tanto, la DEA trata de acercarse a sospechosos traficantes.', 48, 1, 6, 1, 'https://clipwatching.com/4ulnwlx55x9n/Breaking_Bad_1x06_Crazy_Handful_Of_Nothin\'.mkv.html', NULL, NULL),
(10, 'Un trato de no violencia', 'Walter acepta su identidad como traficante de drogas, Jesse decide poner en venta la casa de su tía y Skyler celebra una fiesta del bebe.', 47, 1, 7, 1, 'https://clipwatching.com/izhmly8hv5jc/Breaking_Bad_1x07_A_No-Rough-Stuff-Type_Deal.mkv.html', NULL, NULL),
(11, 'Siete treinta y siete', 'Walter y Jesse tratan de encontrar una forma de desvincularse de Tuco. Hank trata de arreglar el problema entre Marie y Skyler.', 47, 4, 1, 1, 'https://clipwatching.com/5vojhdhbx3wd/Breaking_Bad_2x01_Seven_Thirty-Seven.mkv.html', NULL, NULL),
(12, 'A la parrilla', 'Walter y Jesse son secuestrados por Tuco. Marie y Hank prestan ayuda a Skyler debido a la desaparición de Walt y Hank acaba visitando a la señora Pinkman.', 47, 4, 2, 1, 'https://clipwatching.com/f9qd555kqfub/Breaking_Bad_2x02_Grilled.mkv.html', NULL, NULL),
(13, 'Picado por una abeja muerta', 'Walter y Jesse se van quedando sin dinero mientras tratan de cubrirse las espaldas. Mientras tanto, la DEA obtiene una pista que les podría llevar hacia ambos.', 46, 4, 3, 1, 'https://clipwatching.com/co2m1c0t8ngi/Breaking_Bad_2x03_Bit_By_A_Dead_Bee.mkv.html', NULL, NULL),
(14, 'Abajo', 'Walter trata de reconectar con su familia mientras Jesse se esfuerza en reconstruir su vida.', 47, 4, 4, 1, 'https://clipwatching.com/1kmgfz8p3xim/Breaking_Bad_2x04_Down.mkv.html', NULL, NULL),
(15, 'Rotura', 'Hank sufre como consecuencia de su encuentro con Tuco. Jesse ofrece a sus colegas Combo, Badger y Skinny Pete trabajo distribuyendo la droga por las calles de la ciudad.', 47, 4, 5, 1, 'https://clipwatching.com/epmrw0qgornh/Breaking_Bad_2x05_Breakage.mkv.html', NULL, NULL),
(16, 'Escondite', 'Para mantener su reputación, Jesse tiene que encargarse de un problema. El secreto de Walter entra en peligro cuando Skyler agradece a Gretchen que hayan pagado por el tratamiento del cáncer.', 47, 4, 6, 1, 'https://clipwatching.com/ppzvhg8h7czw/Breaking_Bad_2x06_Peekaboo.mkv.html', NULL, NULL),
(17, 'Negro y azul', 'Jesse y Walt se plantean la posibilidad de expandirse a más territorios. Hank se esfuerza para encajar en El Paso, Skyler busca un nuevo trabajo y Pinkman conoce mejor a su casera.', 47, 4, 7, 1, 'https://clipwatching.com/f1h3drp2djg2/Breaking_Bad_2x07_Negro_Y_Azul.mkv.html', NULL, NULL),
(18, 'Debo llamar a Saul', 'Walt y Jesse reciben ayuda de un abogado muy peculiar cuando Badger tiene problemas con la ley. La DEA cree haber encontrado por fin a Heisenberg y Hank regresa a la ciudad.', 47, 4, 8, 1, 'https://clipwatching.com/hlosjbog4ne8/Breaking_Bad_2x08_Better_Call_Saul.mkv.html', NULL, NULL),
(19, 'Cuatro dias fuera', 'Walter y su familia esperan las novedades de su escáner PET-CT. Jesse y Walt, siguiendo el consejo de Saul, se dirigen al desierto para cocinar durante varios días.', 47, 4, 9, 1, 'https://clipwatching.com/6hw0k8639mnq/Breaking_Bad_2x09_4_Days_Out.mkv.html', NULL, NULL),
(20, 'Encima', 'Walt y Hank tienen una discusión en una fiesta, Skyler comparte sus sentimientos con su jefe y Jane oculta ante su padre la relación con Jesse.', 47, 4, 10, 1, 'https://clipwatching.com/wv57v9kogmdp/Breaking_Bad_2x10_Over.mkv.html', NULL, NULL),
(21, 'Mandala', 'Cuando Walt y Jesse pierden a uno de sus traficantes, Saul sugiere que traten con un nuevo compañero de negocios. Skyler confronta a Ted ante la desconcertante información que ha descubierto. Jesse habla a Jane sobre su ocupación y esto acarrea desastrosas consecuencias.', 47, 4, 11, 1, 'https://clipwatching.com/rg9ns53p4skv/Breaking_Bad_2x11_Mandala.mkv.html', NULL, NULL),
(22, 'Fenix', 'Walt explora opciones para el lavado de dinero y discute con Jesse tras haberse llevado su parte del dinero de su último trato. Jane se enfrenta a su padre con Jesse. Walt toma una decisión mortal.', 47, 4, 12, 1, 'https://clipwatching.com/okyup8wzm02a/Breaking_Bad_2x12_Phoenix.mkv.html', NULL, NULL),
(23, 'Basta de mentiras', 'Skyler confronta a Walt ante su secreto, Jesse se derrumba y el desconsuelo del padre de Jane acaba teniendo graves consecuencias.', 47, 4, 13, 1, 'https://clipwatching.com/ab1fy3eu59w3/Breaking_Bad_2x13_Abq.mkv.html', NULL, NULL),
(24, 'No mas', 'Walt se enfrenta a una nueva amenaza y tiene que tratar con una Skyler cada vez más indignada que, a su vez, debe pensar en que hacer con su vida y la de sus hijos. Jesse descubre varias revelaciones de sí mismo.', 47, 5, 1, 1, 'https://clipwatching.com/efr2cvtl6wir/Breaking_Bad_3x01_No_Ms.mkv.html', NULL, NULL),
(25, 'Caballo sin nombre', 'A pesar del creciente conflicto entre Walt y Skyler, él se esfuerza en hacer todo lo que puede para reconciliarse con su familia. Saul ayuda a Jesse a triunfar en una inusual oportunidad de inversión.', 47, 5, 2, 1, 'https://clipwatching.com/0885rj4ikekj/Breaking_Bad_3x02_Caballo_Sin_Nombre.mkv.html', NULL, NULL),
(26, 'I.F.T.', 'Walt ignora los deseos de Skyler, forzando aún más la situación entre ambos, lo cual lleva a Skyler a actuar. Hank, aún sufriendo el pánico y los ataques de ansiedad, exagera en su trabajo.', 47, 5, 3, 1, 'https://clipwatching.com/lyot8jbcwjlg/Breaking_Bad_3x03_I_F_T_.mkv.html', NULL, NULL),
(27, 'Luz verde', 'Walt pierde el control como consecuencia de la actitud de Skyler y acaba poniendo en peligro su trabajo y sus relaciones con Saul y Jesse. Hank profundiza en su investigación de la droga azul. Jesse tiene un nuevo plan.', 47, 5, 4, 1, 'https://clipwatching.com/9jziye2g4e2d/Breaking_Bad_3x04_Green_Light.mkv.html', NULL, NULL),
(28, 'Mas', 'Gus se sigue esforzando en intentar que Walt vuelva al negocio, lo cual provoca un conflicto entre Walt y Jesse. Skyler tiene dudas acerca de su nueva relación. Marie confiesa a Skyler sus preocupaciones por la actitud de Hank.', 47, 5, 5, 1, 'https://clipwatching.com/27qr535swnyq/Breaking_Bad_3x05_Ms.mkv.html', NULL, NULL),
(29, 'Puesta de sol', 'Walt se establece en sus nuevos alrededores. Walter Jr. busca respuestas sobre el estado de la relación entre sus padres. La investigación de Hank causa graves problemas para Walt y Jesse.', 47, 5, 6, 1, 'https://clipwatching.com/rot1kpxlj097/Breaking_Bad_3x06_Sunset.mkv.html', NULL, NULL),
(30, 'Un minuto', 'La volatilidad de Hank le lleva a un enfrentamiento con Jesse, lo cual se convierte un problema en su trabajo. Skyler presiona a Walt para que haga un trato. Las acciones de Gus acarrean severas consecuencias.', 47, 5, 7, 1, 'https://clipwatching.com/80y1okg8uaer/Breaking_Bad_3x07_One_Minute.mkv.html', NULL, NULL),
(31, 'Te veo', 'La familia espera por noticias sobre el estado de Hank. Mientras Jesse le cubre en el trabajo, Walt trata de reunirse con Gus. Tras observar una reacción inquietante, Walt piensa que él y su familia podrían estar en peligro.', 47, 5, 8, 1, 'https://clipwatching.com/tukfh2b1rmx2/Breaking_Bad_3x08_I_See_You.mkv.html', NULL, NULL),
(32, 'Kafkiano', 'Skyler tiene una idea para pagar los gastos de hospital de Hank. Walt y Gus se reúnen para entenderse mejor. Jesse, en busca de más independencia, piensa en una nueva oportunidad.', 47, 5, 9, 1, 'https://clipwatching.com/71665mk35lph/Breaking_Bad_3x09_Kafkaesque.mkv.html', NULL, NULL),
(33, 'Mosca', 'Walt se obsesiona con un contaminante en el laboratorio, se niega a seguir cocinando hasta que se elimine y Jesse, frustrado, trata de hacer que Walt trabaje.', 47, 5, 10, 1, 'https://clipwatching.com/wngxcrj1azwl/Breaking_Bad_3x10_Fly.mkv.html', NULL, NULL),
(34, 'Abiquiu', 'Skyler se involucra en el negocio de Walt. Hank lucha por recuperarse. Jesse descubre algo sobrecogedor tras conocer a una chica en la terapia de grupo.', 47, 5, 11, 1, 'https://clipwatching.com/q61p484j82pw/Breaking_Bad_3x11_Abiquiu.mkv.html', NULL, NULL),
(35, 'Medidas a medias', 'A pesar de los consejos de Walt, Jesse se dispone a atacar. Temiendo por la seguridad de Jesse, Walt interviene tomando decisiones drásticas. Un trágico evento lleva a una chocante confrontación.', 47, 5, 12, 1, 'https://clipwatching.com/hgkssgrf8lnl/Breaking_Bad_3x12_Half_Measures.mkv.html', NULL, NULL),
(36, 'Medidas totales', 'Con Jesse oculto y Mike buscando su paradero, Walter negocia con Gus y acaba llevando a cabo un plan para asegurar su seguridad y la de Jesse.', 47, 5, 13, 1, 'https://clipwatching.com/1ifhlmx7q5e5/Breaking_Bad_3x13_Full_Measures.mkv.html', NULL, NULL),
(37, 'Cutter', 'Las vidas de Walt y Jesse penden de un hilo mientras Gus toma medidas para garantizar la continuidad de la producción de su producto. Skyler se preocupa por el paradero de Walter y Marie intenta tratar con un deprimido Hank.', 47, 6, 1, 1, 'https://clipwatching.com/q1h52qwhdqys/Breaking_Bad_4x01_Box_Cutter.mkv.html', NULL, NULL),
(38, 'Rechazo a los 38', 'Walt intenta conseguir un nuevo aliado. Skyler trata de aprovechar una oportunidad de hacer negocios para proteger la familia.', 45, 6, 2, 1, 'https://clipwatching.com/vfeb66l6sf7f/Breaking_Bad_4x02_Thirty-Eight_Snub.mkv.html', NULL, NULL),
(39, 'Puertas abiertas', 'Skyler pide ayuda a Saul. Mientras tanto, Marie vuelve a un antiguo y molesto hábito y un amigo de Hank le pide ayuda respecto a un caso.', 46, 6, 3, 1, 'https://clipwatching.com/owm1xzfr0kpq/Breaking_Bad_4x03_Open_House.mkv.html', NULL, NULL),
(40, 'Puntos a tratar', 'El cartel empieza a actuar contra Gus. Walt y Skyler comparten un secreto con el resto de la familia y los actos de Jesse atraen atención innecesaria.', 45, 6, 4, 1, 'https://clipwatching.com/cbiu90wuwkj8/Breaking_Bad_4x04_Bullet_Points.mkv.html', NULL, NULL),
(41, 'Escopeta', 'Jesse desaparece y Walt teme que haya ocurrido lo peor. Skyler tiene una reunión peculiar y Hank comparte malas noticias con el detective Tim Roberts.', 47, 6, 5, 1, 'https://clipwatching.com/h5o4op1oqdas/Breaking_Bad_4x05_Shotgun.mkv.html', NULL, NULL),
(42, 'Acorralado', 'Skyler descubre algo muy inquietante, Walt hace una compra extravagante para su hijo y Jesse sigue ayudando a Mike.', 47, 6, 6, 1, 'https://clipwatching.com/qkbdvytcpi3s/Breaking_Bad_4x06_Cornered.mkv.html', NULL, NULL),
(43, 'Perro problematico', 'Walter apuesta por un nuevo y arriesgado plan. Los negocios de Skyler se complican y Hank se lleva a Walter Jr. de paseo.', 47, 6, 7, 1, 'https://clipwatching.com/yga5ctpekz9w/Breaking_Bad_4x07_Problem_Dog.mkv.html', NULL, NULL),
(44, 'Hermanos', 'Skyler desarrolla una curiosa solución para sus problemas financieros. Hank recluta a Walter para que le ayude en su investigación personal y la falta de paciencia de Walt con Jesse aumenta.', 47, 6, 8, 1, 'https://clipwatching.com/3r3mhubieq49/Breaking_Bad_4x08_Hermanos.mkv.html', NULL, NULL),
