(46, 'Salud', 'La familia de Walter se preocupa cuando él no aparece para el cumpleaños de su hijo. Las habilidades de Jesse en un laboratorio son puestas a prueba sin la ayuda de Walt.', 47, 6, 10, 1, 'https://clipwatching.com/7265x63axnmt/Breaking_Bad_4x10_Salud.mkv.html', NULL, NULL),
(47, 'Rebajarse', 'Walt toma decisiones drásticas para poder proteger tanto a su secreto como a Gus. Los esfuerzos de Skyler por solucionar los problemas financieros de Ted son inútiles.', 47, 6, 11, 1, 'https://clipwatching.com/hk1xddwpawff/Breaking_Bad_4x11_Crawl_Space.mkv.html', NULL, NULL),
(48, 'Fin de los tiempos', 'Hank hace que Gomez investigue una última pista, mientras Walter se esfuerza para proteger a la familia. Al obtener noticias preocupantes, Jesse se dirige rápidamente a reunirse con Walt.', 45, 6, 12, 1, 'https://clipwatching.com/8c6zuf17p3qc/Breaking_Bad_4x12_End_Times.mkv.html', NULL, NULL),
(49, 'Confrontacion', 'Se produce una confrontación con Gus. Walt consigue un aliado inesperado gracias a la ayuda de Saul.', 50, 6, 13, 1, 'https://clipwatching.com/wn3enel1rx2k/Breaking_Bad_4x13_Face_Off.mkv.html', NULL, NULL),
(50, 'Vive libre o muere', 'Mientras Walt trata con las consecuencias de la explosión en Casa Tranquila, Hank trabaja en su investigación acerca del imperio de Gus.', 42, 7, 1, 1, 'https://clipwatching.com/9aacg4ygsdr2/Breaking_Bad_5x01_Live_Free_Or_Die.mkv.html', NULL, NULL),
(51, 'Madrigal', 'Walt y Jesse tratan de convencer a Mike para que se asocie con ellos. Mientras tanto, la DEA sigue nuevas pistas en su investigación del imperio de Gus.', 47, 7, 2, 1, 'https://clipwatching.com/rtlefret41em/Breaking_Bad_5x02_Madrigal.mkv.html', NULL, NULL),
(52, 'Paga de riesgo', 'Walter y Jesse llevan a cabo un plan de negocios. Además, Walt confiesa a Marie un secreto.', 47, 7, 3, 1, 'https://clipwatching.com/38wxcrcfyhqh/Breaking_Bad_5x03_Hazard_Pay.mkv.html', NULL, NULL),
(53, 'Cincuenta y uno', 'Walter celebra otro cumpleaños. Skyler contempla sus opciones. Un socio acaba influyendo en la estrategia de negocios de Walt, Jesse y Mike.', 47, 7, 4, 1, 'https://clipwatching.com/g9k7y0tnd8iq/Breaking_Bad_5x04_Fifty-One.mkv.html', NULL, NULL),
(54, 'Carga mortal', 'El equipo de Walter tiene que empezar utilizar el ingenio para obtener los materiales necesarios para continuar la operación.', 48, 7, 5, 1, 'https://clipwatching.com/n08ry9q7lynq/Breaking_Bad_5x05_Dead_Freight.mkv.html', NULL, NULL),
(55, 'Compra', 'Walt, Jesse y Mike deciden como será el futuro de su negocio, mientras los riesgos del trabajo preocupan a Jesse.', 47, 7, 6, 1, 'https://clipwatching.com/m2yrt515vbib/Breaking_Bad_5x06_Buyout.mkv.html', NULL, NULL),
(56, 'Di mi nombre', 'Walter asume un nuevo nivel de superioridad en su proyecto de negocios. Mike tiene que tratar con las consecuencias de sus actos.', 47, 7, 7, 1, 'https://clipwatching.com/rkh1qtd6vrcr/Breaking_Bad_5x07_Say_My_Name.mkv.html', NULL, NULL),
(57, 'Deslizandose sobre todo', 'Walter se dispone a atar cabos sueltos y, viendo su éxito, acaba haciendo una peligrosa decisión.', 47, 7, 8, 1, 'https://clipwatching.com/7hv4nma33d8q/Breaking_Bad_5x08_Gliding_Over_All.mkv.html', NULL, NULL),
(58, 'Dinero sangriento', 'Hank trata con una revelación imposible. Jesse se encuentra sólo y en un momento de oscuridad. Walter descubre que su secreto está en peligro.', 47, 7, 9, 1, 'https://clipwatching.com/165q57g89j4v/Breaking_Bad_5x09_Blood_Money.mkv.html', NULL, NULL),
(59, 'Enterrado', 'Mientras Walter toma medidas para poner a salvo su dinero, Skyler se ve atrapada entre él y Hank. Jesse continúa sufriendo por su culpabilidad.', 47, 7, 10, 1, 'https://clipwatching.com/gwh37lyzkwe9/Breaking_Bad_5x10_Buried.mkv.html', NULL, NULL),
(60, 'Confesiones', 'Jesse decide llevar a cabo un cambio, mientras que Walter desarrolla un plan para hacer retroceder a Hank.', 47, 7, 11, 1, 'https://clipwatching.com/2wo7wz75sjua/Breaking_Bad_5x11_Confessions.mkv.html', NULL, NULL),
(61, 'Perro rabioso', 'Se empiezan a poner en marcha ciertos planes que podrían cambiarlo todo. Walter considera medidas extremas debido a la amenaza de Jesse.', 47, 7, 12, 1, 'https://clipwatching.com/o94jyxwr99v2/Breaking_Bad_5x12_Rabiod_Dog.mkv.html', NULL, NULL),
(62, 'To\'hajiilee', 'Todd es presionado por mejorar la calidad de su producto. Hank lleva a cabo una maniobra y las cosas se complican para Walt de manera inesperada.', 47, 7, 13, 1, 'https://clipwatching.com/zzbn6qvmp0hm/Breaking_Bad_5x13_To\'hajiilee.mkv.html', NULL, NULL),
(63, 'Ozymandias', 'Walter sufre terribles consecuencias por todo lo que hizo y todos tienen que tratar con circunstancias radicalmente cambiadas.', 47, 7, 14, 1, 'https://clipwatching.com/5d24zo9eash1/Breaking_Bad_5x14_Ozymandias.mkv.html', NULL, NULL),
(64, 'Cincuenta y dos', 'Eventos iniciados mucho tiempo atrás transcurren hacia una conclusión. El prófugo Walter lidia con sus demonios mientras Jesse sigue aprisionado y Skyler sufre las consecuencias de los actos de Walt.', 53, 7, 15, 1, 'https://clipwatching.com/z4dbdfn70p80/Breaking_Bad_5x15_Granite_State.mkv.html', NULL, NULL),
(65, 'Felino', 'Todo lo malo llega a su final en el último episodio de Breaking Bad.', 55, 7, 16, 1, 'https://clipwatching.com/wqlor6kb87lu/Breaking_Bad_5x16_Felina.mkv.html', NULL, NULL),
(66, 'Harold y Kumar van al white ca', 'Harold Lee se encuentra atrapado en un trabajo de bajo nivel en el mundo de las inversiones bancarias, haciendo horas extras y claramente despreciado por sus compañeros, quienes no se molestan en ocultar que le pasan su propio trabajo para que lo termine el fin de semana. Para terminar de complicar las cosas, no se atreve a hablarle a su atractiva vecina cuando se la encuentra en el portal. Mientras que Harold trabaja, su mejor amigo, Kumar Patel hace todo lo que puede para evitar enfrentarse al mundo real, manteniendo su modo de vida ocioso y despreocupado, mientras que simula vagos intentos de ser admitido en la facultad de medicina para seguir la tradición familiar.', 80, 8, 1, 4, 'https://highstream.tv/s6ygzfv8mxew/Dos_Colgaos_Muy_Fumaos..[DVDRIP][Spanish][www.PorTorrent.com.avi.html', NULL, NULL),
(67, 'Harold y Kumar en Guantanamo', 'Harold (Cho) y Kumar (Penn) hacen un viaje a Amsterdam para coger suministros pero, durante el viaje, son confundidos con dos terroristas islámicos con intenciones de secuestrar el avión. Les detienen y son enviados a la prisión americana de Guantánamo, Cuba. Allí empieza una historia hilarante que les llevará a las situaciones más surrealistas y desesperadas.', 89, 8, 2, 4, 'https://highstream.tv/9ifn0uwj0cj6/Dos_Colgaos_Muy_Fumaos_Fuga_de_Guantanamo..[DVDRIP][Spanish][www.PorTorrent.com].avi.html', NULL, NULL),
(68, 'Harold y Kumar en navidad', 'Seis años después de su aventura en la Bahía Guantánamo, Harold Lee y Kumar Patel causan una crisis navideña cuando sin querer incendian el árbol de Navidad del padre de Maria, la esposa de Harold. A partir de ese momento su navidad solo se centra en encontrar un árbol idéntico al que Kumar incendió, pero llegar a el será mucho más difícil de lo que ellos creían.', 90, 8, 3, 4, 'https://highstream.tv/j3jf61vpdzsk/DcolgaosFumaosNavidadbrripspa_[www.newpct.com].avi.html', NULL, NULL);

