) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

--
-- Volcado de datos para la tabla `seriespeliculas`
--

INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(1, 'Breaking Bad', 'Tras cumplir 50 años, Walter White (Bryan Cranston), un profesor de química de un instituto de Albuquerque, Nuevo México, se entera de que tiene un cáncer de pulmón incurable. Casado con Skyler (Anna Gunn) y con un hijo discapacitado (RJ Mitte), la brutal noticia lo impulsa a dar un drástico cambio a su vida: decide, con la ayuda de un antiguo alumno (Aaron Paul), fabricar anfetaminas y ponerlas a la venta. Lo que pretende es liberar a su familia de problemas económicos cuando se produzca el fatal desenlace.', 2, 16, '2008-01-20', 'Vince Gilligan', , 1, 1);
INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(2, 'South Park', 'South Park es una serie de televisión estadounidense de animación, creada por Trey Parker y Matt Stone para el canal Comedy Central. Está dirigida al público adulto y se caracteriza por satirizar con humor negro la sociedad, actualidad y cultura estadounidense a través de las historias y situaciones surrealistas que les suceden a sus protagonistas, cuatro niños (Stan, Kyle, Cartman y Kenny) residentes en un pueblo ficticio de Colorado que se llama South Park.', 1, 18, '1997-08-13', 'Parker-Stone', , 2, 0);
INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(3, 'Stalingrado', 'Noviembre de 1942. Continúa el implacable asedio a la ciudad de Stalingrado durante la Segunda Guerra Mundial. Rodeados de tropas alemanas y escasos de municiones, un grupo de soldados rusos se preparan para defender un edificio hasta el final.', 6, 13, '2013-10-09', 'Fyodor Bondarchuk', , 3, 1);
INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(4, 'Harold y Kumar', 'Trilogia de Harold y Kumar', 1, 13, '2004-05-30', 'Danny Leiner', , 8, 1);
INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(5, 'Shameless', 'Remake norteamericano de la serie británica sobre la peculiar familia Gallagher, en la que Frank (William H. Macy), un padre soltero y alcohólico, trata de educar a sus seis inteligentes, salvajes e independientes hijos', 1, 18, '2009-01-09', 'John Wells', , 9, 1);
INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(6, 'Silicon Valley', 'En la fiebre del oro de alta tecnología moderna de Silicon Valley, las personas más calificadas para tener éxito son los menos capaces de manejar el éxito. Parcialmente inspirada en las propias experiencias de Mike Judge como ingeniero de Silicon Valley a finales de los años 80, Silicon Valley es una comedia de situación estadounidense que se centra en torno a seis programadores que están viviendo juntos y tratando de hacer algo grande en el Silicon Valley.', 1, 12, '2014-04-06', 'Mike Judge', , 11, 0);
INSERT INTO `seriespeliculas` (`idseriespeliculas`, `titulo`, `descripcion`, `idcategoria`, `edadminima`, `fecha_estreno`, `director`, `portada`, `idtemporda`, `existe`) VALUES
(7, 'Sherlock', 'El detective más famoso e influyente de la historia vuelve a la acción. Sherlock, interpretado por el premiado actor Benedict Cumberbatch, conoce por casualidad al soldado John Watson. Aunque en un primer encuentro se dan cuenta que no pueden ser más diferentes el uno del otro, se convierten en una pareja insuperable a la hora de combatir el crimen aunando el pragmatismo de John y el sensacional uso de la deducción de Sherlock.', 2, 7, '2010-07-25', 'Mark Gatiss', , 12, 0);

